"use strict";Vue.component("v-block",{template:'\n    <div class="v-block" :style="boxStyle">\n      <div class="header" v-if="!noHeader">\n        <span>{{label}}</span>\n      </div>\n      <div class="content"><slot>content</slot></div>\n      <div class="angle top-left"></div>\n      <div class="angle top-right"></div>\n      <div class="angle bottom-left"></div>\n      <div class="angle bottom-right"></div>\n    </div>',props:{label:{type:String,default:"主标题"},rect:{type:Array,default:function(){return[40,20,460,462]}},noHeader:Boolean},computed:{boxStyle:function(){return{position:"absolute",left:this.rect[0]+"px",top:this.rect[1]+"px",width:this.rect[2]+"px",height:this.rect[3]+"px"}}}});